import "./header.css"
import RegisterCandidato from "../../pages/AuthCandidato/Register";
import { useEffect, useState } from "react";

function Header(){

    const [logado, setLogado] = useState(false);

    useEffect(()=>{
        const token = localStorage.getItem('token');
        if(token){
            setLogado(true)
        }else{
            setLogado(false);
        }
    }, [])

    return(
        <>
        <header>
            <div>
                <h2>CONNECT VAGAS</h2>
            </div>
            
            <nav>
                <ul>   
                    <li><a>VAGAS</a></li>
                    <li><a href="/register/candidato">CANDIDATO</a></li>
                    <li><a>MINHA EMPRESA</a></li>
                </ul>
            </nav>
        </header>
        </>
    )
}
export default Header;
